import "./../css/main_login.css";

export default function Login() {
  return (
    <div class="user-groupslogin">
      <div class="user-groups" >
            <a href='#'> <img class="user-group-icon" src="student-icon.png" ></img> </a>
            <a href='#'> <p class="text-main">Φοιτητές </p></a>

      </div>
    </div>
  );
}
